H-SIK, an electronic music producer from Ivory coast known for his dark and textured take on music. He infuses obscured samples and abstracted effects with influences from old-school hip-hop, dub and hybrid grime and footwork. His obsessive exploration of minimal rhythms, effects and samples allows his music to be unfold into a thrashed out, deeply layered sound.

