RCola's rub-a-dub-wize Drum 'n Bass takes its' inspirations from reggae & dub, which continue to influence his uplifting production style.  https://rcola.bandcamp.com
&#13;
RCola co-founded the Chopstick Dubplate record label with Liondub and Jacky Murda in 2002. In 2004, he started the JungleXpeditions music group and his Royal Crown label, which has featured songs from legendary reggae singers Sister Nancy and Barrington Levy. &#13;
&#13;
In 2010, KMag named RCola one of the top ten ragga-jungle artists in the world. There's no doubt this was fueled by his continued efforts to keep jungle music up front and center over the last ten years. &#13;
&#13;
RCola has played 300+ shows in 20 countries, and released 25 tunes on 12" vinyl, and more music digitally via online shops.
